  InputAddonProps,
  Omit<InputAddonProps, 'placement'>
>((props, ref) => {
  return (
    <InputAddon className="left-addon" placement="left" ref={ref} {...props} />
  );
});

InputLeftAddon.displayName = 'InputLeftAddon';

